import React from 'react';
import emila from '../images/emila.jpg';
class ThSection extends React.Component {
    render() {

        return (
            <section className="">
                <div className="content">
                    <div className="host_photo">
                       < img src={emila}></ img>
                    </div>
                    <div className="big_squaer">
                        <h2>Location</h2>
                        <div className="short_border"></div>
                    </div>
                </div>
            

            </section>
        )
    }
}






            
export default ThSection;
